export default function Review() {
  return (
    <Container fluid className="mt--7">
      <Row>
        <Col>
          <SimpleListTable
          query_key={'complaint_orders'}
          query_fn={getMessagesTypeByGq}
          filter={{ type: 'offer' }}
          />
        </Col>
      </Row>
    </Container>
  );
};

Review.propTypes = {};
Review.defaultProps = {};
